  false,\n\t\"url\": null,\n\t\"notes\": \"In 2006 and 2007, the U.S. Geological Survey,
  in partnership with Louisiana Department of Natural Resources and the University
  of New Orleans, conducted geologic mapping to characterize the sea floor and shallow
  subsurface stratigraphy offshore of the Chandeleur Islands in Eastern Louisiana.
  The mapping was carried out during two cruises on the R/V Acadiana. Data were acquired
  with the following equipment: an SEA Ltd SwathPlus interferometric sonar (234 kHz),
  Klein 3000 dual frequency sidescan sonar, and an Edgetech 512i chirp subbottom profiling
  system. The long-term goal of this mapping effort is to produce high-quality geologic
  maps and geophysical interpretations that can be utilized to investigate the impact
  of Hurricane Katrina in 2005 and to identify sand resources within the region.\",\n\t\"license_title\":
